import { makeStyles } from '@material-ui/core/styles';
import { deepPurple } from '@material-ui/core/colors';

export default makeStyles((theme) => ({
  appBar: {
    borderRadius: 20,
    margin: '30px 0',
    display: 'full-screen',
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 50px',
    background:"White",
    border: "solid",
    borderColor:"black"

  },
  heading: {
    color: 'rgba(0,183,255, 1)',
    textDecoration: 'none',
  },
  image: {
    marginLeft: '15px',
  },
  toolbar: {
    display: 'flex',
    justifyContent: 'flex-end',
    width: '600px',
  },
  profile: {
    display: 'flex',
    justifyContent: 'space-between',
    width: '500px',
  },
  userName: {
    display: 'flex',
    alignItems: 'center',
  },
  brandContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  avatar: {
    width:"100px",
    height:"100px"
  },
  logout: {
    marginTop:"20px",
    width:"120px",
    height:"50px"
  }
}));
